import "./Home.css";
import { LinearProgress } from "@mui/material";

const Home = () => {
  return (
    <>
      <div className="section">
        <div className="card-body border-0 col-sm-12">header</div>
        <div className="col-sm-12">
          <div className="row">
            <div className="col-sm-1"></div>
            <div className="col-sm-10">
            <div className="card border-0">
          <div className="card-header bg-transparent border-bottom-0">head</div>
          <div className="card-body border-0">body</div>
          <div className="card-footer bg-transparent border-top-0">footer</div>
        </div>
            </div>
            <div className="col-sm-1"></div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
